// ** Icons Import
import { Circle, FilePlus } from 'react-feather'

export default [
  {
    id: 'sales',
    title: 'Sales',
    icon: <FilePlus />,
    children: [
      {
        id: 'proposal',
        title: 'Proposal',
        icon: <Circle />,
        navLink: '/charts/chartjs'
      },
      {
        id: 'invoice',
        title: 'Invoice',
        icon: <Circle />,
        navLink: '/charts/apex'
      }
    ]
  }
]
